import './components.css'

function Themes(){
    return(
        <div class='themes-section'>
            <div>
                <h1 class> SENSE OF DIRECTION </h1>
                <input type="Checkbox" name="blue" value="yes" Checked>Blue</input>
                <input type="Checkbox" name="red" value="yes">Red</input>
                <input type="Checkbox" name="green" value="yes">Green</input>
            </div>
            <h1> SENSE OF URGENCY </h1>
        </div>
    )   
}


export default Themes;
